<style>
body {
font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;

color: #00205B;
display: flex;
justify-content: center;
align-items: center;
height: 100vh;
margin: 0;
}


.card {
width: 100%;
max-width: 420px;
padding: 40px 20px;
text-align: center;
color: #00205B;
}


.photo {
width: 150px;
height: 150px;
border-radius: 50%;
object-fit: cover;
margin: 20px auto;
border: 3px solid #00205B;
box-shadow: 0 4px 10px rgba(0, 0, 0, 0.2);
}


h1 {
font-size: 1.6rem;
margin: 10px 0 0 0;
color: #00205B;
}


h2 {
font-size: 1rem;
margin: 5px 0 25px 0;
font-weight: normal;
color: #1a3163;
}


.contact {
margin-top: 20px;
line-height: 1.8;
font-size: 0.95rem;
}


.contact a {
text-decoration: none;
color: #00205B;
transition: color 0.3s;
}


.contact a:hover {
color: #1a3163;
}


.logo-space img {
margin-top: 30px;
width: 180px;
height: auto;
}
</style>
